{ entry = 151636,  name = "The Cenarion Circle reside in the Dreamgrove. They are the guardians of nature, the preservers of balance, and the protectors of all life." },
{ entry = 151638,  name = "Parts of the bag are falling apart." },
{ entry = 151639,  name = "The Illidari reside in the Fel Hammer. They wield the forbidden powers of the demons they slay to fight the forces of chaos - at any cost." },
{ entry = 151640,  name = "The Knights of the Ebon Blade reside in Acherus, the Ebon Hold. They were once the champions of the scourge. They are now the damned." },
{ entry = 151641,  name = "The Unseen Path reside in the Trueshot Lodge. They are the watchers in the wild. They are the eagle on the wind. They walk the lonely road." },
{ entry = 151642,  name = "The Tirisgarde reside in the Hall of the Guardian. They are the elite mage-guard of Dalaran, called upon in the past by the Council of Tirisfal to do battle in the absence of the Guardian." },
