{ entry = 151643,  name = "The Order of the Broken Temple reside in the Temple of the Five Dawns. They are the bringers of hope to a dim future." },
{ entry = 151644,  name = "The Order of the Silver Hand reside in the Sanctum of Light. They are the united might of the Argent Crusade, the Hand of Argus, the Sunwalkers, and the Blood Knights." },
{ entry = 151645,  name = "Teaches you how to summon and dismiss Dibbler." },
{ entry = 151646,  name = "The Conclave reside in the Netherlight Temple. They are the masters of the Light and embracers of the Void - for light cannot exist without darkness, and darkness without light." },
{ entry = 151647,  name = "The Earthen Ring reside in the Heart of Azeroth. They wield the power of the elemental forces between which they maintain balance. They are the true masters of the elements." },
{ entry = 151648,  name = "Tortollans must have strong stomachs if Kajosh is willing to eat raw raptor meat." },
{ entry = 151649,  name = "The Council of the Black Harvest reside in the Dreadscar Rift. They are the takers of souls, the commanders of demons, and the masters of the dark arts." },
{ entry = 151650,  name = "The Valarjar reside in the Skyhold. They are the mighty ascended champions of Odyn who protect the world from all threats." },
