{ entry = 194021,  name = "The left side of the map is completely illegible, covered by a dark stain, as if someone's hand, full of ink, was intentionally dragged over the area to hide something." },
{ entry = 194022,  name = "Expansive waters cover the top of the parchment, with various volcanic depictions and winding rivers throughout." },
{ entry = 194023,  name = "The dark stain in the lower left portion of the map remains. Whatever resides in the area is surely meant to be left unfound." },
{ entry = 194024,  name = "Winding rivers marked by large, head-like symbols are scattered across the parchment." },
{ entry = 194025,  name = "The text beneath the map is largely faded and unrecognizable. A large spire, swirling with energy appears in the bottom left of the parchment." },
{ entry = 194026,  name = "Winding rivers cover the map. Several head-like symbols appear at various locations. A very large spire, swirling with energy sits alone to the southwest." },
