{ entry = 194028,  name = "The ink on the map appears to be moving as swirls of black slowly drift across a mountainous region." },
{ entry = 194029,  name = "The swirling ink snaps into position, revealing a large, central area with several surrounding structures, a disc with geometric shapes in the top left corner, and a large, temple-like structure in the middle of the map." },
