{ entry = 202697,  name = "The pinnacle of whelp comfort." },
{ entry = 202698,  name = "The dragons have ruled us because theY're stronger than we. But together, in our great numbers, we're stronger than they. If might makes right, then we are right, if we haVe courage to riSe up together. - Instigator Belaphon" },
{ entry = 202699,  name = "FoR 100 Years, theY left us alone, while we tended to " },
{ entry = 202700,  name = "The dragons returned expecting us to Be what we were, but in tHose 100 Centuries, we changed. We grew. We serve them no longer, and are serFs no longer. We've chosen our Path for 10,000 years, and we will do so again. - Instigator Belaphon" },
{ entry = 202701,  name = "And so we Swear one and all to the rebel code. No ruler but one's selF. No purpose but independence. No flight but the flightless. - Instigator Belaphon" },
{ entry = 202702,  name = "The dragons believE they're worth more than us. That's why Sendrax had to sacrifice herself, foR a dragon egg that might not even be viable. They say she's a herO, but she's really their victim. - Instigator Belaphon" },
{ entry = 202703,  name = "The grains of sand disappear as you watch it." },
