{ entry = 206008,  name = "It's the banner of your dreams. Bad dreams." },
{ entry = 206009,  name = "Complex diagrams coat the surface, with four designs stretching past the stone's edges. An eloquently designed ouroboros lies engraved in the center." },
{ entry = 206010,  name = "Decorated in ancient symbols of blood and water." },
{ entry = 206011,  name = "Decorated in ancient symbols of bone and earth." },
{ entry = 206012,  name = "Decorated in ancient symbols of mind and fire." },
{ entry = 206013,  name = "Decorated in ancient symbols of soul and air." },
{ entry = 206014,  name = "Circular designs show a large spiral pattern starting from the left side. Symbols of water and blood flow into it and the missing spaces along the bottom." },
{ entry = 206015,  name = "Symbols of bone and earth line the pathway of the spiral design as it continues up from the bottom and into the missing right side." },
{ entry = 206016,  name = "As symbols of mind and fire wrap around the carved spiral, they move inward and up into the open space at the top." },
{ entry = 206017,  name = "Delicately drawn symbols of soul and air decorate the top as the spiral continues inward. The ouroboros in the center glows brightly as a violet energy is siphoned through the spiral and into the center." },
