{ entry = 208937,  name = "You found this journal in the grass, its pages are covered with mud. The very last pages of its content is a window to a broken soul." },
{ entry = 208938,  name = "The lingering embers in this ash seem to change shape as you watch them." },
{ entry = 208939,  name = "Malice and hatred honed into a weapon designed to lay waste to entire worlds. Beware of any who envy such a blade." },
{ entry = 208940,  name = "A gift of Dimensius bestowed at the height of the Black Empire. Those touched by shadow are drawn to its haunting whispers." },
{ entry = 208941,  name = "Shadows cannot be allowed to fester. Disorder must be struck down wherever it takes hold. True children of the titans will heed their makers' call." },
{ entry = 208943,  name = "Armaments forged from the primal fabric of the cosmos. Who assembled this collection and why remains a mystery. Wielding them will draw the eye of those who covet such power." },
{ entry = 208945,  name = "Unfortunately, for the health of the timeline, it is recomended this be opened after being sent." },
