{ entry = 213020,  name = "Through careful scrutiny, it can be determined the date of this shovel's creation. More importantly, that will reveal when agriculture was introduced." },
{ entry = 213021,  name = "The cork seems to have fused with the bottle over an eternity of decay. There's as much to be learned from opening it as there is from not." },
{ entry = 213022,  name = "While almost impossible to determine the age of this particular hammer, the materials used to forge it can reveal much of the civilization's technology." },
{ entry = 213023,  name = "Once the djaradin discovered oil, there was nothing they wouldn't use it in. Fires, weapons, recreation, all were impacted by this new discovery." },
{ entry = 213024,  name = "Little is known about the djaradin's specific culture, but one has to come to certain conclusions when they discover mugs stained in blood." },
{ entry = 213025,  name = "As cruel a century ago as they are today, djaradin weapons have advanced little since their rise to power." },
{ entry = 213026,  name = "Large drakonkin wield these brushes with surprising dexterity, from painting homes to intricate murals." },
{ entry = 213027,  name = "Worth a small fortune in its heyday, this poorly preserved chalice will fetch only a meager price at a local vendor." },
{ entry = 213028,  name = "Used to create vast archives of maps and sea charts, finding a compass is only the first step in discovering an ancient civilization's technological prowess." },
{ entry = 213029,  name = "A drakonid fork may seem mundane to the untrained eye, but this tool belies the sophistication of its manufacturer." },
{ entry = 213030,  name = "A small dot of blood marking the tip of the shears may explain why a frustrated gardener discarded this tool long ago." },
{ entry = 213031,  name = "The years have done their damage to this goblet, but a keen eye can still learn much from the remains." },
{ entry = 213032,  name = "The accompanying lid no longer fits the jar, but now can be used as a tiny saucer." },
{ entry = 213033,  name = "This battlescarred pair of tongs have stoked fires for centuries. Tiny imperfections and knicks in the metal reveal much of what they handled." },
{ entry = 213034,  name = "Unsuitable for practical use, this lovely bowl would make an excellent centerpiece in any archaeologist's gallery." },
{ entry = 213035,  name = "Caked in a myriade of dried paints, this brush is a treasure trove of specimen samples from various pigments and solutions." },
{ entry = 213037,  name = "Years of use have seen this trowel become damaged beyond repair. Oh the stories it could tell." },
{ entry = 213038,  name = "This may have been helpful for reading the fine print in Neltharion's plans for the dracthyr." },
{ entry = 213039,  name = "Everything from utensils to cutlery serve to tell the stories of the local people in their day to day lives." },
{ entry = 213040,  name = "Weathering has rendered much of the intricacies of this amulet indecipherable, but the general shape may shed some light on djaradin customs." },
{ entry = 213041,  name = "After painstakingly collecting enough scraps to piece together this rare find, it turns out that this scroll is covered in meaningless doodles." },
{ entry = 213042,  name = "Flown during peacetime and war, a djaradin banner shows its age through the rips and tears it endures over a long life." },
{ entry = 213043,  name = "Hardly useful for crafting anymore, this leather comes from an unidentifiable source that is better left to the imagination." },
{ entry = 213044,  name = "Upon closer inspection, the fang for this amulet appears to be from a djaradin. Perhaps a battle trophy?" },
{ entry = 213045,  name = "Little can be learned from this broken amulet, as half of its pieces have gone missing throughout the years." },
{ entry = 213062,  name = "Though its bright hues are reminiscent of jungle birds' feathers, its edge does not tickle." },
