{ entry = 213192,  name = "Someone made sure that each name was rendered illegible before discarding the list." },
{ entry = 213193,  name = "Muck stains its polished surface" },
{ entry = 213194,  name = "This clump of hardened foodstuffs could offer insight into what was eaten on this island." },
{ entry = 213195,  name = "Most of this paper has been destroyed, but the parts you can make out depict horns and angry eyebrows." },
{ entry = 213196,  name = "This bloom was dried and pressed, preserved between the pages of a now-lost book." },
{ entry = 213197,  name = "A rare herb that emanates a feeling of nothingness. Sometimes gathered by players with the Herbalism skill. Can be bought and sold on the Auction House." },
{ entry = 213200,  name = "It's a marvel a book this flimsy has survived. The scribbles within suggest that someone took this nonsense very seriously." },
{ entry = 213201,  name = "The dragonkin here were fond of ducks, but these bones suggest they were at times used for food." },
{ entry = 213202,  name = "A Tiny Explorer's Hat" },
{ entry = 213203,  name = "This fine hood must have belonged to someone important. It has two holes cut out for horns." },
{ entry = 213204,  name = "Inside, there is a sketch of a red drakonid guard with a handsome grin." },
{ entry = 213205,  name = "These star charts go far afield of reality. Studying the stars isn't for the faint of heart." },
{ entry = 213206,  name = "The legible bits suggest this was once an angry rebuttal from a fellow scholar." },
{ entry = 213207,  name = "A Tiny Ear Warmer" },
{ entry = 213208,  name = "Someone must have been saving these for a special occasion that never arose." },
{ entry = 213209,  name = "Warm and quivering. Probably a kobold delicacy." },
{ entry = 213210,  name = "This torn bit of banner fabric was used as a bandage at some point." },
{ entry = 213211,  name = "These flower petals were picked off one-by-one and discarded into cooling magma." },
{ entry = 213212,  name = "These were carried by Tuskarr fisherman and are useful for cutting rope." },
{ entry = 213213,  name = "Though dessicated, these resemble the fungi that are cultivated in Zaralek Cavern today." },
{ entry = 213214,  name = "Made from heat-resistant grasses, the design resembles a Tuskarr woven crab trap." },
{ entry = 213215,  name = "A face has been carved into this stone, to be offered to some unknown Djaradin diety." },
{ entry = 213216,  name = "This piece of hide has been marked dozens of times, though what it commemorates is unknown." },

