{ entry = 213357,  name = "Peering into the bowl, it feels like you can almost make out an image. Or that's your reflection." },
{ entry = 213358,  name = "There may have been great wisdom to be gleaned from this rare find, but whoever found it first plunged a pickaxe straight into it!" },
{ entry = 213359,  name = "Time has rendered this magical focus inert, but the engravings along the shaft tell an even deeper story." },
{ entry = 213360,  name = "The gem this amulet once held has been pried free, reducing its value to nearly worthless." },
{ entry = 213361,  name = "Children have taken an alarming shine to unsettling figurines. Maybe it's better left a mystery." },
{ entry = 213362,  name = "It may have retained its form, but surely this rock-hard drakonid treat is past its expiration date." },
{ entry = 213363,  name = "When reptiles shed their scales, many species shed the skin on their eyes as well. During this time, the creatures are often blind and defenseless." },
{ entry = 213364,  name = "A lovely aroma still lingers on the rim." },
{ entry = 213365,  name = "Intricate shapes have been carved into this crystal, causing the light to shine in unique patterns." },
{ entry = 213395,  name = "Fitting attire for a midnight rendezvous." },
{ entry = 213366,  name = "Comparing the material and design of this niffen hat to ones commonly used today, one can extrapolate the evolution of niffen fashion." },
{ entry = 213367,  name = "This appears to be a rudimentary attempt at upgrading niffen digging capabilities. The project seems to have been scrapped due to lack of necessity." },
{ entry = 213368,  name = "Scratching this stone goes against all archaeological principles. Sure is tempting though." },
{ entry = 213374,  name = "Niffen noses are so sensitive, sometimes they just need a way to shut out the day and get some sleep." },
